import styles from './Skills.module.scss';


export default function Skills(json: any) {
    console.log(json);
    
    return (
        <section className={styles.skills}>
            <h2>Skills</h2>
            <ul>
                <li>HTML</li>
                <li>CSS</li>
                <li>JavaScript</li>
                <li>React</li>
                <li>Node</li>
                <li>Git</li>
                <li>GitHub</li>
                <li>Scrum</li>
            </ul>
        </section>
    );
}
